import { Link } from "react-router-dom";

export default function Landing() {
  return (
    <div className="h-screen flex flex-col justify-center items-center bg-blue-50">
      <h1 className="text-4xl font-bold mb-4">Digital KYC System</h1>
      <div className="space-x-4">
        <Link to="/register" className="px-6 py-2 bg-blue-600 text-white rounded">Register</Link>
        <Link to="/login" className="px-6 py-2 bg-green-600 text-white rounded">Login</Link>
      </div>
    </div>
  );
}
